import React from 'react';
import ReactDOM from 'react-dom';
import './styles/index.css';
import App from './App';
import { BrowserRouter as Router } from 'react-router-dom';

document.title = "African MarketP"

ReactDOM.render(
  <Router>
    <App />
  </Router>,
  document.getElementById('root')
);
